export const Accordion = [
    {
        id: 1,
        heading: 'heading 1',
        text: 'Array.prototype.map(1) expects a value to be returned at the end of arrow function',

    },
    {
        id: 2,
        heading: 'heading 2',
        text: 'Array.prototype.map(2) expects a value to be returned at the end of arrow function',

    },
    {
        id: 3,
        heading: 'heading 3',
        text: 'Array.prototype.map(3) expects a value to be returned at the end of arrow function',

    },
    {
        id: 4,
        heading: 'heading 4',
        text: 'Array.prototype.map(4) expects a value to be returned at the end of arrow function',

    },
];
